import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Card, ListGroupItem, ListGroup } from 'react-bootstrap';


class StockComp extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            name: this.props.item.name,
            stockPrice: this.props.item.stockPrice,
            perform: this.props.item.perform,
            sector: this.props.item.sector
        }
    }

    render() {
        return (
            <Card
                bg={'success'}
                text={'light'}
                style={{ width: '18rem' }}
                className="mb-2">
                <Card.Header>Header</Card.Header>
                <Card.Body>
                        <Card.Title>Card Title</Card.Title>
                    <ListGroup className="list-group-flush">
                        <ListGroupItem><Card.Text>Yurrrrrr</Card.Text></ListGroupItem>
                        <ListGroupItem><Card.Link href="#">Card Link</Card.Link></ListGroupItem>
                    </ListGroup>
                </Card.Body>
            </Card>
        )
    }
}


export default StockComp;
